import React from "react";

const Preview = ({ title, items }) => {
  return (
    <div className="collect-preview">
      <h1 className="title">{title.toUpperCase()}</h1>
      <div className="preview">
       {items.map(item=>{

        return(<div key={item.id}>{item.name}</div>)



       })}
      </div>
    </div>
  );
};
export default Preview;
